import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';

const PageOne = () => (<div>1</div>);
const PageTwo = () => (<div>2</div>);

const App = () => {
    return (
        <BrowserRouter>
            <div>
                <Route path='/' exact component={PageOne}></Route>
                <Route path='/' exact component={PageTwo}></Route>
            </div>
        </BrowserRouter>
    );
}

export default App;
